import React from 'react'
import './seap.component.scss'

export default function Vopsele() {
    return (
        <div className="seap-message">
            <div className="display-2"><h1>Seap</h1></div>
            <p>Sunteti o institutie a statului si vreti sa achizitionati materiale de constructii la preturi avantajoase?</p>
            <p>Daca aveti un necesar trasmiteti-l telefonic la nr de telefon 0756 200 090 sau pe mail "office@paisconstruct.ro" iar ne ocupam de urcarea lui in SEAP pentru ca dvs sa-l puteti achizitiona.  Si stati fara griji , avem cont si in Trezorerie.</p>
        </div>
    )
}
